import React from 'react';

const Services = () => {
    return (
        <div>
            <h2>Our Services</h2>
            <ul>
                <li>Smart Lighting</li>
                <li>Security Systems</li>
                <li>Climate Control</li>
            </ul>
        </div>
    );
};

export default Services;
